import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="nav-title">
        <h1>Workout Buddy</h1>
      </div>
      <Link to="/register">
        <div className="nav-content">
          <p>Sign up</p>
        </div>
      </Link>
      <Link to="/">
        <div className="nav-content">
          <p>Logout</p>
        </div>
      </Link>
    </div>
  );
};

export default Navbar;
